import React from 'react';
import s from "./Navbar.module.css";
import { NavLink } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav className={s.nav}>
            <div className={`${s.item} ${s.active}`}><NavLink
             href="/profile">Profile</NavLink
            ></div>
            <div className={s.item}><NavLink
             href="/messages">Messages</NavLink
            ></div>
            <div className={s.item}><NavLink
             href="/news">News</NavLink
            ></div>
            <div className={s.item}><NavLink
             href="/musics">Music</NavLink
            ></div>
            <div className={s.item}><NavLink
             href="/settings">Settings</NavLink
            ></div>
        </nav>
    );
}

export default Navbar;
